window.bookSummaryJSON = "<p>Being a necromancer is kinda cool until you wake up half dead in a dumpster. </p> <p>Cisco Suarez is into something bad. Wanted by police, drenched in the stink of dark magic, and nether creatures coming out of the woodwork. Is resurrection overrated or what? </p> <p>This box set contains the first three Black Magic Outlaw novels (<i>Dead Man</i>, <i>Shadow Play</i>, and <i>Heart Strings</i>) all at one special omnibus price. </p>"; 
